properties.approved_maps:
The four United States Geological Survey (USGS) 1:24,000 scale topographic maps used to determine the boundary of the Lower Long Tom viticultural area are titled:
(1) Cheshire, Oregon, 1984;

(2) Horton, Oregon, 1984;

(3) Glenbrook, Oregon, 1984; and

(4) Monroe, Oregon, 1991.

